// React
import React, { Fragment } from "react";

import { Row, Col, Card } from "antd";

const OrderedList = ({ data }) => {
  console.log(data);
  return (
    <Fragment>
      <Row>
        {data.map(data => (
          <Col span={5} offset={1} className="w-50">
            <Card
              title={data.table}
              cover={
                <img
                  alt="example"
                  src="https://source.unsplash.com/weekly?flower"
                />
              }
            ></Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default OrderedList;
